package com.bytefinger.toutuo.biz.projectcompany.service.impl;import com.baomidou.mybatisplus.core.metadata.IPage;import com.baomidou.mybatisplus.extension.plugins.pagination.Page;import com.baomidou.mybatisplus.extension.service.impl.ServiceImpl;import com.bytefinger.common.das.domain.vo.QueryPage;import com.bytefinger.common.security.annotation.DataFill;import com.bytefinger.toutuo.biz.companyfinance.domain.ProjectCompanyPayment;import com.bytefinger.toutuo.biz.projectcompany.domain.ProjectCompanyExecutives;import com.bytefinger.toutuo.biz.projectcompany.mapper.ProjectCompanyExecutivesMapper;import com.bytefinger.toutuo.biz.projectcompany.service.IProjectCompanyExecutivesService;import com.bytefinger.toutuo.common.service.BizService;import org.springframework.stereotype.Service;import org.springframework.util.CollectionUtils;/** * <p> * 股权合作项目-公司高管信息 服务实现类 * </p> * * @author Jone * @since 2023-02-01 */@Servicepublic class ProjectCompanyExecutivesServiceImpl extends BizService<ProjectCompanyExecutivesMapper, ProjectCompanyExecutives> implements IProjectCompanyExecutivesService {    @Override    @DataFill    public IPage<ProjectCompanyExecutives> page(QueryPage queryPage) {        return this.page(queryPage.toPage(), queryPage.getWrapper());    }    @Override    @DataFill    public IPage<ProjectCompanyExecutives> page(Long stepMenuId, QueryPage queryPage) {        Page<ProjectCompanyExecutives> page = this.page(queryPage.toPage(), queryPage.getWrapper());        if(CollectionUtils.isEmpty(page.getRecords())){            return page;        }        super.dataFillDcoument(stepMenuId, page);        return page;    }}